import logoHeader from "../images/logo.svg";
import { Switch, Link } from 'react-router-dom'

function Header() {
  return (
    <header className="header">
      <img
        src={logoHeader}
        alt="логотип проекта Место"
        className="header__logo"
      />
      <nav>
        <ul className="nav">
          <Switch>
            <Route path="/sign-up">
            <li><Link to="/sign-in" className="nav__link">Войти</Link></li>
            </Route>
            <Route path="/sign-in">
              <li><Link to="/sign-up" className="nav__link">Регистрация</Link></li>
            </Route>
          </Switch>
        </ul>
      </nav>
    </header>
  );
}

export default Header;
